CREATE DEFINER=`root`@`localhost` PROCEDURE `ColumnsGET`()
BEGIN
    SELECT `COLUMN_NAME` 
FROM `INFORMATION_SCHEMA`.`COLUMNS` 
WHERE `TABLE_SCHEMA`='white_cheese' AND `COLUMN_NAME` NOT LIKE "ID_%" AND `COLUMN_NAME` NOT LIKE "PDF_%"
    AND (`TABLE_NAME`='tb_pessoa_fisica'  
    OR  `TABLE_NAME`='tb_rg' 
    OR  `TABLE_NAME`='tb_cnh'
    OR  `TABLE_NAME`='tb_bancos'
    OR  `TABLE_NAME`='tb_contas_bancarios'
    OR  `TABLE_NAME`='tb_imoveis'
    OR  `TABLE_NAME`='tb_enderecos')
    ORDER BY 
    CASE `COLUMN_NAME` 
        WHEN 'NOME_COMPLETO' THEN 0 
        ELSE `COLUMN_NAME` END 
    ASC;
END ;;
