CREATE DEFINER=`root`@`localhost` PROCEDURE `EnderecosPOST`(
    IN oENDERECO VARCHAR(45),
    IN oLOGADOURO VARCHAR(45),
    IN oNUMERO VARCHAR(45),
    IN oCOMPLEMENTO VARCHAR(64),
    IN oCEP VARCHAR(15),
    IN oBAIRRO VARCHAR(45),
    IN oCIDADE VARCHAR(45),
    IN oESTADO VARCHAR(2),
    IN oLATITUDE DECIMAL(9,7),
    IN oLONGITUDE DECIMAL(9,7),
