	IF (ID IS NULL)
    THEN
    INSERT INTO TB_ENDERECOS(
                ENDERECO,
                LOGADOURO,
                NUMERO,
                COMPLEMENTO,
                CEP,
                BAIRRO,
                CIDADE,
                ESTADO,
                LATITUDE,
                LONGITUDE
            )
            VALUES(
                oENDERECO,
                oLOGADOURO,
                oNUMERO,
                oCOMPLEMENTO,
                oCEP,
                oBAIRRO,
                oCIDADE,
                oESTADO,
                oLATITUDE,
                oLONGITUDE
            );
		ELSE
        UPDATE TB_ENDERECOS
        SET
				ENDERECO = oENDERECO,
                LOGADOURO = oLOGADOURO,
                NUMERO = oNUMERO,
                COMPLEMENTO = oCOMPLEMENTO,
                CEP = oCEP,
                BAIRRO = oBAIRRO,
                CIDADE = oCIDADE,
                ESTADO = oESTADO,
                LATITUDE = oLATITUDE,
                LONGITUDE = LONGITUDE
		WHERE ID_ENDERECO = ID;
        END IF;
        
END ;;
