CREATE DEFINER=`root`@`localhost` PROCEDURE `PessoaFisicaPOST`(
										IN oNOME_COMPLETO VARCHAR(128),
                                        IN oSEXO enum('MASCULINO', 'FEMININO'),                                        
                                        IN oDATA_NASCIMENTO DATE,
                                        IN oALCUNHA VARCHAR(128),
                                        IN oNATURALIDADE VARCHAR(64),
                                        IN oNATURALIZADO BOOLEAN,
                                        IN oCPF VARCHAR(13),
                                        IN oEMAIL VARCHAR(128),
                                        IN oESTADO_CIVIL char(30),
                                        IN oGRAU_INSTRUCAO VARCHAR(32),
                                        IN oFORMULA_FUNDAMENTAL varchar(128),
                                        IN oNOME_PAI varchar(128),
                                        IN oNOME_MAE varchar(128),
                                        IN oCOR_OLHOS varchar(16),
                                        IN oCABELO varchar(16),
                                        IN oCOR_PELE varchar(16),
                                        IN oPROFISSAO varchar(128),
                                        IN oPOSSUI_RG BOOLEAN,
                                        IN oPOSSUI_CNH BOOLEAN,
                                        IN oIMG_FOTO_PESSOA LONGTEXT,
                                        
                                        IN oNUMERO_RG varchar(14),
                                        IN oDATA_EXPEDICAO date,
                                        IN oUF char(2),
                                        IN oORGAO_EMISSOR varchar(128),
                                        
                                        IN oNUMERO_CNH varchar(13),
                                        IN oCATEGORIA_CNH set('A','B','C','D','E'),
                                        IN oPPD BOOLEAN,
                                        IN oPRIMEIRA_HABILITACAO DATE,

                                        IN oID_PESSOA BIGINT
									)
BEGIN
	IF (oID_PESSOA IS NULL)
    THEN
	INSERT INTO TB_PESSOA_FISICA(
                    NOME_COMPLETO,
                    SEXO,
                    DATA_NASCIMENTO,
                    ALCUNHA,
                    NATURALIDADE,
                    NATURALIZADO,
                    CPF,
                    EMAIL,
                    ESTADO_CIVIL,
                    GRAU_INSTRUCAO,
                    FORMULA_FUNDAMENTAL,
                    NOME_PAI,
                    NOME_MAE,
                    COR_OLHOS,
                    CABELO,
                    COR_PELE,
                    PROFISSAO,
                    IMG_FOTO_PESSOA
                ) VALUES (
                    oNOME_COMPLETO,
                    oSEXO,
                    oDATA_NASCIMENTO,
                    oALCUNHA,
                    oNATURALIDADE,
                    oNATURALIZADO,
                    oCPF,
                    oEMAIL,
                    oESTADO_CIVIL,
                    oGRAU_INSTRUCAO,
                    oFORMULA_FUNDAMENTAL,
                    oNOME_PAI,
                    oNOME_MAE,
                    oCOR_OLHOS,
                    oCABELO,
                    oCOR_PELE,
                    oPROFISSAO,
                    oIMG_FOTO_PESSOA
                );
	
	SET @ID =  LAST_INSERT_ID();

    IF(oNUMERO_RG IS NOT NULL)
    THEN
        INSERT INTO TB_RG (
                ID_RG_PESSOA,
                NUMERO_RG,
                DATA_EXPEDICAO,
                UF,
                ORGAO_EMISSOR
            )
            VALUES
            (
                @ID,
                oNUMERO_RG,
                oDATA_EXPEDICAO,
                oUF,
                oORGAO_EMISSOR
            );

        UPDATE TB_PESSOA_FISICA 
            SET POSSUI_RG = 1
            WHERE ID_PESSOA = @ID;
    END IF;

    IF (oNUMERO_CNH IS NOT NULL)
    THEN 
        INSERT INTO TB_CNH(
                ID_CNH_PESSOA,
                NUMERO_CNH,
                CATEGORIA_CNH,
                PPD,
                PRIMEIRA_HABILITACAO
            )
            VALUES(
                @ID,
                oNUMERO_CNH,
                oCATEGORIA_CNH,
                oPPD,
                oPRIMEIRA_HABILITACAO
            );

        UPDATE TB_PESSOA_FISICA 
            SET POSSUI_CNH = 1
            WHERE ID_PESSOA = @ID;
    END IF;
    ELSE
		UPDATE TB_PESSOA_FISICA
        SET  
					NOME_COMPLETO = oNOME_COMPLETO,
                    SEXO = oSEXO,
                    DATA_NASCIMENTO = oDATA_NASCIMENTO,
                    ALCUNHA = oALCUNHA,
                    NATURALIDADE = oNATURALIDADE,
                    NATURALIZADO = oNATURALIZADO,
                    CPF = oCPF,
                    EMAIL = oEMAIL,
                    ESTADO_CIVIL = oESTADO_CIVIL,
                    GRAU_INSTRUCAO = oGRAU_INSTRUCAO,
                    FORMULA_FUNDAMENTAL = oFORMULA_FUNDAMENTAL,
                    NOME_PAI =oNOME_PAI,
                    NOME_MAE = oNOME_MAE,
                    COR_OLHOS = oCOR_OLHOS,
                    CABELO = oCABELO,
                    COR_PELE = oCOR_PELE,
                    PROFISSAO = oPROFISSAO,
                    IMG_FOTO_PESSOA = oIMG_FOTO_PESSOA
			WHERE ID_PESSOA = oID_PESSOA;
            
            IF (oNUMERO_RG IS NOT NULL)
            THEN
				IF(EXISTS(SELECT 1 FROM TB_RG WHERE ID_RG_PESSOA = @ID))
				THEN
					UPDATE TB_RG
					SET 
						ID_RG_PESSOA = oID_RG_PESSOA,
						NUMERO_RG = oNUMERO_RG,
						DATA_EXPEDICAO = oDATA_EXPEDICAO,
						UF = oUF,
						ORGAO_EMISSOR = oORGAO_EMISSOR
					WHERE ID_RG_PESSOA = oID_PESSOA;
				ELSE
					INSERT INTO TB_RG (
						ID_RG_PESSOA,
						NUMERO_RG,
						DATA_EXPEDICAO,
						UF,
						ORGAO_EMISSOR
					)
					VALUES
					(
						@ID,
						oNUMERO_RG,
						oDATA_EXPEDICAO,
						oUF,
						oORGAO_EMISSOR
					);
				END IF;
            END IF;
            
            IF (oNUMERO_CNH IS NOT NULL)
            THEN
				IF (EXISTS(SELECT 1 FROM TB_CNH WHERE ID_CNH_PESSOA = @ID))
				THEN
					UPDATE TB_CNH
					SET 
						ID_CNH_PESSOA = oID_CNH_PESSOA,
						NUMERO_CNH = oNUMERO_CNH,
						CATEGORIA_CNH = oCATEGORIA_CNH,
						PPD = oPPD,
						PRIMEIRA_HABILITACAO = oPRIMEIRA_HABILITACAO
					WHERE ID_CNH_PESSOA = oID_PESSOA;
				ELSE
			
					INSERT INTO TB_CNH(
						ID_CNH_PESSOA,
						NUMERO_CNH,
						CATEGORIA_CNH,
						PPD,
						PRIMEIRA_HABILITACAO
					)
					VALUES(
					@ID,
					oNUMERO_CNH,
					oCATEGORIA_CNH,
					oPPD,
					oPRIMEIRA_HABILITACAO
					);
				END IF;
            END IF;
	END IF;

END ;;
DELIMITER ;
