CREATE DEFINER=`root`@`localhost` PROCEDURE `PF_EnderecoPUT`(
IN _CPF VARCHAR(13),
IN _TITULO_ELEITOR VARCHAR(22),
IN _NOME_COMPLETO VARCHAR(128),
IN _DATA_NASCIMENTO DATE,
IN _NOME_PAI varchar(128),
IN _NOME_MAE varchar(128),
IN _NATURALIDADE VARCHAR(64),
IN _COD_VERIFICACAO VARCHAR(128),

IN _ENDERECO VARCHAR(45),
IN _CIDADE VARCHAR(45),
IN _DATA_DOMICILIO DATE

)
BEGIN
	
    INSERT INTO TB_ENDERECOS
    (
		ENDERECO,
        CIDADE,
        DATA_DOMICILIO
    )VALUES(
		_ENDERECO,
        _CIDADE,
        _DATA_DOMICILIO
    );
    
    SET @ID_ENDERECO =  LAST_INSERT_ID();

	IF (EXISTS (SELECT 1 FROM TB_PESSOA_FISICA WHERE CPF = _CPF))
    THEN
		UPDATE TB_PESSOA_FISICA
		SET
		NOME_COMPLETO = _NOME_COMPLETO,
		DATA_NASCIMENTO = _DATA_NASCIMENTO,
		NOME_PAI = _NOME_PAI,
		NOME_MAE = _NOME_MAE,
		NATURALIDADE  = _NATURALIDADE,
		COD_VERIFICACAO = _COD_VERIFICACAO,
        TITULO_ELEITOR = _TITULO_ELEITOR,
        ID_ENDERECO = @ID_ENDERECO
		WHERE CPF = _CPF;
    
    ELSE
		INSERT INTO TB_PESSOA_FISICA
		(
			CPF,
			NOME_COMPLETO,
			DATA_NASCIMENTO,
			NOME_PAI,
			NOME_MAE,
			NATURALIDADE,
			COD_VERIFICACAO,
            TITULO_ELEITOR,
            ID_ENDERECO
		)VALUES(
			_CPF,
			_NOME_COMPLETO,
			_DATA_NASCIMENTO,
			_NOME_PAI,
			_NOME_MAE,
			_NATURALIDADE,
			_COD_VERIFICACAO,
            _TITULO_ELEITOR,
            @ID_ENDERECO
        );
        
	END IF;
		
END ;;
DELIMITER ;
