CREATE DEFINER=`root`@`localhost` PROCEDURE `RgPOST`(
IN _ID_PESSOA BIGINT,
IN _NUMERO_RG VARCHAR(14))
BEGIN
	IF (EXISTS (SELECT 1 FROM TB_RG WHERE ID_RG_PESSOA = _ID_PESSOA))
    THEN
		UPDATE TB_RG
        SET NUMERO_RG = _NUMERO_RG
        WHERE ID_RG_PESSOA = _ID_PESSOA;
    ELSE
		INSERT INTO TB_RG
        (ID_RG_PESSOA, NUMERO_RG)
        VALUES
        (_ID_PESSOA, _NUMERO_RG);
    END IF;
    
    UPDATE TB_PESSOA_FISICA
    SET POSSUI_RG = 1
    WHERE ID_PESSOA = _ID_PESSOA;
    
END ;;
