CREATE DEFINER=`root`@`localhost` PROCEDURE `Tabelas2GET`(IN ID BIGINT)
BEGIN

SELECT * 
FROM TB_PESSOA_FISICA P
LEFT JOIN TB_RG R
	ON (P.ID_PESSOA = R.ID_RG_PESSOA)
LEFT JOIN TB_CNH CN 
	ON (P.ID_PESSOA = CN.ID_CNH_PESSOA)
LEFT JOIN TB_CONTAS_BANCARIAS C
    ON (C.ID_PESSOA = P.ID_PESSOA) 
LEFT JOIN TB_BANCOS B
    ON (B.ID_BANCO = C.ID_BANCO)
LEFT JOIN TB_IMOVEIS I
    ON (P.ID_PESSOA = I.ID_PESSOA)
LEFT JOIN TB_ENDERECOS E
    ON(I.ID_ENDERECO = E.ID_ENDERECO) 
WHERE P.ID_PESSOA = ID;
    
END ;;
DELIMITER ;
