CREATE DEFINER=`root`@`localhost` PROCEDURE `TabelasGET`(IN ID BIGINT)
BEGIN
SELECT * FROM TB_PESSOA_FISICA WHERE ID_PESSOA = ID;

SELECT * FROM TB_RG WHERE ID_RG_PESSOA = ID;

SELECT * FROM TB_CNH WHERE ID_CNH_PESSOA = ID;

SELECT C.ID_CONTA_BANCARIA, C.NUM_CONTA, C.NUM_AGENCIA, C.ID_PESSOA, C.ID_BANCO
	FROM TB_CONTAS_BANCARIAS C 
    INNER JOIN TB_PESSOA_FISICA P 
    ON (C.ID_PESSOA = P.ID_PESSOA) 
    WHERE P.ID_PESSOA = ID;
    
SELECT B.ID_BANCO, B.NOME, B.COD_BANCO
	FROM TB_BANCOS B
    INNER JOIN TB_CONTAS_BANCARIAS C
    ON (B.ID_BANCO = C.ID_BANCO)
    INNER JOIN TB_PESSOA_FISICA P
    ON (P.ID_PESSOA = C.ID_PESSOA)
    WHERE P.ID_PESSOA = ID;
    
SELECT I.ID_IMOVEL, I.RGI, I.ESCRITURA, I.MATRICULA, I.AREA, I.PERIMETRO, I.VALOR, I.ID_PESSOA, I.ID_ENDERECO 
	FROM TB_IMOVEIS I
    INNER JOIN TB_PESSOA_FISICA P
    ON (P.ID_PESSOA = I.ID_PESSOA)
    WHERE P.ID_PESSOA = ID;
    
SELECT E.ID_ENDERECO, E.ENDERECO, E.LOGADOURO, E.NUMERO, E.COMPLEMENTO, E.CEP, E.BAIRRO, E.CIDADE, E.ESTADO, E.LATITUDE, E.LONGITUDE
	FROM TB_ENDERECOS E
    INNER JOIN TB_IMOVEIS I 
    ON(I.ID_ENDERECO = E.ID_ENDERECO)
    INNER JOIN TB_PESSOA_FISICA P
    ON(P.ID_PESSOA = I.ID_PESSOA)
    WHERE P.ID_PESSOA = ID;
    
END ;;
