DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `UsuariosPOST`(
    IN oNOME VARCHAR(45),
    IN oSOBRENOME VARCHAR(45),
    IN oEMAIL VARCHAR(45),
    IN oUSERNAME VARCHAR(45),
    IN oSENHA VARCHAR(128),
    IN oID_ENDERECO BIGINT,
    IN ID BIGINT
)
BEGIN
	IF (ID IS NULL)
    THEN
    INSERT INTO TB_USUARIOS(
                NOME,
                SOBRENOME,
                EMAIL,
                USERNAME,
                SENHA,
                ID_ENDERECO
            )
            VALUES(
                oNOME,
                oSOBRENOME,
                oEMAIL,
                oUSERNAME,
                oSENHA,
                oID_ENDERECO
            );
	ELSE
    UPDATE TB_USUARIOS
    SET 
		NOME = oNOME,
        SOBRENOME = oSOBRENOME,
        EMAIL = oEMAIL,
        USERNAME = oUSERNAME,
        SENHA = oSENHA,
        ID_ENDERECO = oID_ENDERECO
	WHERE ID_USUARIO = ID;
    END IF;
END ;;
